    const HomePage = () => {
      var settings = {
        dots: true,
        infinite: true,
        speed: 500,
        slidesToShow: 1,
        slidesToScroll: 1,
        autoplay: true
      };


  return (
    <div className="home-container">
      <section className="hero-section">


        <Slider {...settings}>
      <div>
        <h3>KBO 타자 TOP5 랭킹</h3>
        <p>이미지 추가</p>
      </div>
      <div>
