      </div>
      <div>
        <h3>KBO 투수 TOP5 랭킹</h3>
        <p>이미지 추가</p>
      </div>
      <div>
        <h3>MLB 투수 TOP5 랭킹</h3>
        <p>이미지 추가</p>
      </div>
    </Slider>  
      </section>
      <section className='team-ranking'>
        <h2>팀순위</h2>
        <div className='team-ranking-container'>
          <div className='team-ranking-item'>
            <h3>1</h3>
          </div>
        </div>
      </section>

    </div>
  );
};

export default HomePage;
